import React,{useState} from "react";
import SideBar from "./Sidebar";
import NavBar from "./Navbar";
import { Link } from "react-router-dom";
function TeacherProfile(){
  const username = localStorage.getItem('username');
  const [teachername, setTeachername] = useState('')
  const [subject, setSubject] = useState('')
  const [email,setEmail] = useState('')
  const [phno,setPhno]=useState('')
  const [address,setAddress]=useState('')
  const [image,setImage]=useState('');



  const handleSubmit = (e)=>{
    e.preventDefault()
    // let params = {
    //     teachername:teachername,
    //     subject:subject,
    //     email:email,
    //     phno:phno,
    //     address:address
       
    // }

        
    // e.preventDefault();	
    let formData = new FormData();
    formData.append('teachername', teachername);
    formData.append('image', image);
    formData.append('subject', subject);
    formData.append('email',email);
    formData.append('phno',phno);
    formData.append('address',address)
  

    fetch('http://localhost:4002/addteacher', {
        method: 'POST',
        body: formData
    })
    .then((res) => res.json())
    .then((result) => {
        window.location.reload();
    });

}
    return(
        <>
         {/* <h1>Welcome, {username}!</h1> */}
        <div class="content">
        <SideBar></SideBar>
        <NavBar></NavBar>
        <div style={{ display: 'flex', flexDirection: 'column', marginLeft:'300px', alignItems: 'center', justifyContent: 'center', minHeight: '100vh', padding: '20px' }}>
        <div class="container-fluid pt-4 px-4 ">
                <div class="row g-4 ">
                    
                    
                <div class="col-sm-12 col-xl-6 alert alert-primary">
                        <div class="bg-light rounded h-100 p-4">
                            <h4 class="mb-4 text-center"> Profile</h4>
                                <div className="text-center">
                                <img className="rounded-circle " src="img/user.jpg" alt="" style={{ width: '100px', height: '100px' }} />
                                </div><br></br>
                        
                <form action="" method="post" onSubmit={handleSubmit}>
                <div className="mb-3 ">
                  <label htmlFor="exampleInputEmail1" className="form-label"> Name</label>
                  <input type="text" value={username} name='teachername' onChange={(e)=>setTeachername(e.target.value)}className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                </div>
                <div className="mb-3">
                  <label htmlFor="exampleInputtext" className="form-label">Email</label>
                  <input type="email"name='subject'className="form-control" onChange={(e)=>setEmail(e.target.value)} id="exampleInputtext" />
                </div>
                <div className="mb-3">
                  <label htmlFor="exampleInputtext" className="form-label">Subject</label>
                  <input type="text" name='subject'className="form-control" onChange={(e)=>setSubject(e.target.value)} id="exampleInputtext" />
                </div>
                <div className="mb-3">
                  <label htmlFor="exampleInputtext" className="form-label">Phone no</label>
                  <input type="text" name='subject'className="form-control"onChange={(e)=>setPhno(e.target.value)} id="exampleInputtext" />
                </div>
                <div className="mb-3">
                  <label htmlFor="exampleInputtext" className="form-label">Address</label>
                  <input type="text" name='subject'className="form-control" onChange={(e)=>setAddress(e.target.value)} id="exampleInputtext" />
                </div>
                <div className="mb-3">
                  <label htmlFor="exampleInputtext" className="form-label">Image</label>
                  <input type="file" name='image'className="form-control"  onChange={(e)=>setImage(e.target.files[0])}id="exampleInputtext" />
                </div>


                 <button type="submit" className="btn btn-primary">SUB</button> 
                 <Link to="/teacheredit"  style={{ marginLeft: '20px',border:'2px solid',borderRadius:'20px',padding:'8px'}}>Edit</Link> 
               </form>

                      </div> 
                      </div> 




                </div> 

        </div> 


</div> 
        </div>  
        </>
    )
}
export default TeacherProfile
